  `fijoCliente` int(10) DEFAULT NULL COMMENT 'Teléfono fijo del cliente',
  `celularCliente` int(10) DEFAULT NULL COMMENT 'Celular del cliente',
  `correoCliente` varchar(40) DEFAULT NULL COMMENT 'Correo electrónico del cliente',
