  `totalVenta` double(10,2) DEFAULT NULL,
  `formaVenta` varchar(50) DEFAULT NULL,
  `cantidadProducto` int(10) DEFAULT NULL,
  `horaVenta` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `estadoVenta` tinyint(255) DEFAULT '0',
  PRIMARY KEY (`idVenta`),
  KEY `fkProductoCompra` (`idProducto`),
  CONSTRAINT `fkProductoCompra` FOREIGN KEY (`idProducto`) REFERENCES `modelo` (`idModelo`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=latin1;

