-- ----------------------------
-- View structure for v_categoria
-- ----------------------------
DROP VIEW IF EXISTS `v_categoria`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_categoria` AS select `categoria`.`idCategoria` AS `codigo`,`categoria`.`nombreCategoria` AS `nombre` from `categoria` ;

-- ----------------------------
-- View structure for v_compra
-- ----------------------------
DROP VIEW IF EXISTS `v_compra`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_compra` AS select `venta`.`idVenta` AS `codigo`,`venta`.`identificacionCliente` AS `cliente`,`venta`.`nombreCliente` AS `nombre`,`venta`.`direccionCliente` AS `direccion`,`venta`.`fijoCliente` AS `fijo`,`venta`.`celularCliente` AS `celular`,`venta`.`correoCliente` AS `correo`,`venta`.`idProducto` AS `producto`,`modelo`.`nombreModelo` AS `modelo`,`categoria`.`nombreCategoria` AS `categoria`,`marca`.`nombreMarca` AS `marca` from (((`venta` join `modelo` on((`venta`.`idProducto` = `modelo`.`idModelo`))) join `categoria` on((`modelo`.`fkCategoria` = `categoria`.`idCategoria`))) join `marca` on((`modelo`.`fkMarca` = `marca`.`idMarca`))) ;

-- ----------------------------
-- View structure for v_marca
-- ----------------------------
DROP VIEW IF EXISTS `v_marca`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_marca` AS select `marca`.`idMarca` AS `codigo`,`marca`.`nombreMarca` AS `nombre` from `marca` ;

-- ----------------------------
-- View structure for v_modelo
-- ----------------------------
DROP VIEW IF EXISTS `v_modelo`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_modelo` AS select `modelo`.`nombreModelo` AS `modelo`,`marca`.`nombreMarca` AS `marca`,`categoria`.`nombreCategoria` AS `categoria`,`modelo`.`idModelo` AS `codigo`,`modelo`.`tituloModelo` AS `titulo`,`modelo`.`precioModelo` AS `precio`,`modelo`.`publicacionModelo` AS `publicacion`,`modelo`.`stock` AS `stock` from ((`modelo` join `marca` on((`modelo`.`fkMarca` = `marca`.`idMarca`))) join `categoria` on((`modelo`.`fkCategoria` = `categoria`.`idCategoria`))) ;
DROP TRIGGER IF EXISTS `modificarCantidad`;
DELIMITER ;;
CREATE TRIGGER `modificarCantidad` AFTER INSERT ON `venta` FOR EACH ROW UPDATE `modelo` SET `stock`=modelo.stock-new.cantidadProducto WHERE (`idModelo`=new.idProducto) LIMIT 1
;;
DELIMITER ;
